            color: #df8b0e;
        }
        #chart-container {
            position: relative;
            width: 98vw;
            height: 95vh;
        }
        #loading-indicator, #error-indicator {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 1.5em;
            display: none;
        }
        #legend-container {
            position: absolute;
            bottom: 10px;
            left: 10px;
            background-color: rgba(0, 0, 0, 0.5);
            padding: 10px;
            border-radius: 5px;
            display: flex;
            gap: 15px;
            font-size: 0.9em;
        }
        .legend-item {
            display: flex;
            align-items: center;
            gap: 5px;
        }

            // 5. 지표 그리기 헬퍼 함수
            function drawPsarIndicators(chart, ohlcData) {
                const psarUpSeries = chart.addSeries(LightweightCharts.LineSeries,{ color: 'rgba(0,0,0,0)', lastValueVisible: false, priceLineVisible: false });
                const psarDownSeries = chart.addSeries(LightweightCharts.LineSeries,{  color: 'rgba(0,0,0,0)', lastValueVisible: false, priceLineVisible: false });
                const hpsarBullSeries = chart.addSeries(LightweightCharts.LineSeries,{  color: 'rgba(0,0,0,0)', lastValueVisible: false, priceLineVisible: false });
                const hpsarBearSeries = chart.addSeries(LightweightCharts.LineSeries,{  color: 'rgba(0,0,0,0)', lastValueVisible: false, priceLineVisible: false });

                const psarUpMarkers = [], psarDownMarkers = [], hpsarBullMarkers = [], hpsarBearMarkers = [];
                const psarUpData = [], psarDownData = [], hpsarBullData = [], hpsarBearData = [];

                ohlcData.forEach(d => {
                    if (d.psar !== null) {
                        const marker = { time: d.time, position: 'inBar', shape: 'circle', size: 0.05 };
                        if (d.psar < d.close) {
                            psarUpData.push({ time: d.time, value: d.psar });
                            psarUpMarkers.push({ ...marker, color: '#26A69A' });
                        } else {
                            psarDownData.push({ time: d.time, value: d.psar });
                            psarDownMarkers.push({ ...marker, color: '#EF5350' });
                        }
                    }
                    if (d.h_psar !== null) {
                        const isBullishReversal = d.close > d.psar;
                        if (isBullishReversal) {
                            hpsarBearData.push({ time: d.time, value: d.h_psar });
                            hpsarBearMarkers.push({ time: d.time, position: 'inBar', shape: 'arrowDown', color: '#FFD700' });
                        } else {
                            hpsarBullData.push({ time: d.time, value: d.h_psar });
                            hpsarBullMarkers.push({ time: d.time, position: 'inBar', shape: 'arrowUp', color: '#3498DB' });
                        }
                    }
                });
                psarUpSeries.setData(psarUpData); psarUpSeries.setMarkers(psarUpMarkers);
                psarDownSeries.setData(psarDownData); psarDownSeries.setMarkers(psarDownMarkers);
                hpsarBullSeries.setData(hpsarBullData); hpsarBullSeries.setMarkers(hpsarBullMarkers);
                hpsarBearSeries.setData(hpsarBearData); hpsarBearSeries.setMarkers(hpsarBearMarkers);
            }

            function drawSmaIndicators(chart, ohlcData) {
                if (!ohlcData || ohlcData.length === 0) return;
                const smaColors = ['#4183D7', '#D91E18', '#2ECC71', '#F1C40F', '#9B59B6'];
                const smaKeys = Object.keys(ohlcData[0]).filter(key => key.startsWith('sma_')).sort((a, b) => parseInt(a.split('_')[1], 10) - parseInt(b.split('_')[1], 10));
                
                smaKeys.forEach((key, index) => {
                    const smaSeries = chart.addSeries(LightweightCharts.LineSeries,{ color: smaColors[index % smaColors.length], lineWidth: 1, title: key.toUpperCase() });
                    const smaData = ohlcData.filter(d => d[key] !== null).map(d => ({ time: d.time, value: d[key] }));
                    smaSeries.setData(smaData);
                });
            }

            function adjustPaneHeights() {
                const panes = chart.panes();
                const totalHeight = chartContainer.clientHeight;
                
                if (panes.length > 1) {
                    const mainPaneHeight = Math.floor(totalHeight * 0.7); // 70%
                    const indicatorPaneHeight = Math.floor(totalHeight * 0.3); // 30%
                    
                    panes[0].setHeight(mainPaneHeight);
                    // panes[0].setWidth(chartContainer.clientWidth)
                    panes[1].setHeight(indicatorPaneHeight);
                    // panes[1].setWidth(chartContainer.clientWidth)
                }
            }            

            window.addEventListener('resize', adjustPaneHeights);
            main();
        });
